      else
        len = length(gas)
        Stream.iterate(0, &(&1 + 1))
        |> Enum.reduce_while({gas, cost, len}, fn start, {[gh | gt] = gas, [gc | tc] = cost, len} ->
          if start > len do
            {:halt, -1}
          else
            if move(gas, cost, 0) do
              {:halt, elem(Enum.at(gas, 0), 1)}
            else
              {:cont, {gt ++ [gh], tc ++ [gc], len}}
            end
          end
        end)
      end
    else
      -1
    end
  end

  def filter([], [], gacc, cacc), do: {Enum.reverse(gacc), Enum.reverse(cacc)}
  def filter([hg | tg], [hc | tc], gacc, cacc) do
    if elem(hg, 0) == elem(hc, 0) do
      filter(tg, tc, gacc, cacc)
    else
      filter(tg, tc, [hg | gacc], [hc | cacc])
    end
  end

  def move([], _, _), do: true
  def move([hg | tg], [hc | tc], fuel) do
    fuel = fuel + elem(hg, 0)
    spend = elem(hc, 0)
    if fuel >= spend do
      move(tg, tc, fuel - spend)
    else
      false
    end
  end
end
